import styles from "./Button.module.css"


const Button = ( props ) => 
{
    return(
    <div className={`${styles["button"]}`}>
        <span></span>
        <span></span>
        <span></span>
        <span></span>
        <button type={props.type} onClick={props.onClick}>
            {props.children}
        </button>
    </div>
    );
}

export default Button;
